                </div>
                <div>
                    <label htmlFor = "guardian-full-name-field">Guardian Full Name</label>
                    <input id = "guardian-full-name-field" class = "registration-wide-input-field" type = "text" value = {guardian_full_name} onChange = {(e) => SetGuardianFullName(e.target.value)} />
                </div>
                <div>
                    <label htmlFor = "guardian-full-name-field">Guardian Full Name</label>
                    <input id = "guardian-full-name-field" class = "registration-wide-input-field" type = "text" value = {guardian_full_name} onChange = {(e) => SetGuardianFullName(e.target.value)} />
                </div>
                <input type = "submit" />
            </form>
        </div>
    )
